import './App.css';
import Navbar from './components/Navbar';
import Projects from './components/pages/Projects';
import Contact from './components/pages/Contact';



function App() {
  let component
  switch (window.location.pathname){
    case "/projects":
        component = <Projects />;
        break;
    case "/contact":
        component = <Contact />;
        break;
    default:
      //do nothing
  }
  return (
    <div className="App">
      <Navbar />
      {component}
    </div>
  );
}

export default App;
